import React from "react";

const Inputs = () => {
  return (
    <div className="input-div">
      <h2>Grade type %</h2>
      <div className="inputs">
        <div className="assignment-inputs">
          <label>Assignments</label>
          <input className="input assName"></input>
        </div>
        <div className="grade-inputs">
          <label>Grade %</label>
          <input className="input gradeNum"></input>
        </div>
        <div className="weight-inputs">
          <label>Weight %</label>
          <input className="input weightNum"></input>
        </div>
      </div>
      <button className="addRow">+ Add row</button>
    </div>
  );
};

export default Inputs;
